      SELECT ALL * FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT - 89 + 92 IN ( + + col1 * + col1 + CAST ( + 47 AS INTEGER ) + - ( + + col2 ) * + col1, - 12 );
  - name: tab0

outputs:
  - name: q12555.out
    data: |
      15	81	47
      87	21	10
      97	1	99
